import React from 'react';
import './App.css';
import './Menu.css';


function StartMenu({ startQuiz}) {
    return (
        <div className="start-menu">
            <h1>Welcome to FLAG_GUESSER</h1>
            <button onClick={startQuiz}>Click to begin</button>
        </div>
    );
}
export default StartMenu;
